import React, { useState } from 'react';
import './App.css';
function App() {
  const [currentSection, setCurrentSection] = useState('home');
  const handleNavClick = (section) => {
    setCurrentSection(section);
  };
  return (
    <div className="App">
      <Navbar handleNavClick={handleNavClick} />
      <div className="content">
        {currentSection === 'home' && <Home />}
        {currentSection === 'projects' && <Projects />}
        {currentSection === 'about' && <About />}
        {currentSection === 'contact' && <Contact />}
      </div>
    </div>
  );
}
function Navbar({ handleNavClick }) {
  return (
    <nav className="navbar">
      <ul>
        <li><button onClick={() => handleNavClick('home')}>Overview</button></li>
        <li><button onClick={() => handleNavClick('projects')}>Projects</button></li>
        <li><button onClick={() => handleNavClick('about')}>About</button></li>
        <li><button onClick={() => handleNavClick('contact')}>Contact Info</button></li>
      </ul>
    </nav>
  );
}
function Home() {
  return (
    <section id="home" className="section">
      <h2><strong> &emsp; Amulya Parashar</strong></h2>
      <p>
        <ul>
          <li> Student in <strong>MIT Manipal</strong>.</li>
          <li> Proffecient Coder in<strong> 
            <ul>
              <li> C/C++ </li>
              <li> Java</li>
              <li> SQL</li>
              <li> Python</li>
              <li> HTML CSS and Javascript</li>
            </ul>
            </strong>
          </li>
        </ul>
        &emsp; My SkillSets extends to <strong>Data Structures and Algorithms(DSA), Object Oriented Programming(OOPs), Power Bi and Data Analytics</strong> 
      </p>
    </section>
  );
}
function Projects() {
  return (
    <section id="projects" className="section">
      <h2>Projects</h2>
      <p>&emsp; <ol></ol>Github JavaScript Projects : 
        <ul>
          <li> 2048 Game : <a href='https://github.com/KING-258/JS/tree/main/2048'>ðŸ”—</a></li>
          <li> Tic Tac Toe : <a href='https://github.com/KING-258/JS/tree/main/TicTacToe'>ðŸ”—</a></li>
          <li> MineSweeper : <a href='https://github.com/KING-258/JS/tree/main/Minesweeper_AI'>ðŸ”—</a></li>
          <li> KnapSack Problem Visualiser : <a href='https://github.com/KING-258/JS/tree/main/KnapSack_FrontEND'>ðŸ”—</a></li>
          <li> Card Guessing Game : <a href='https://github.com/KING-258/JS/tree/main/CardsHi-Lo'>ðŸ”—</a></li>
          <li> Nokia Snake Game : <a href='https://github.com/KING-258/JS/tree/main/Snake_Xenia'>ðŸ”—</a></li>
          <li> Chrome Dino with <strong>3JS</strong> : <a href='https://github.com/KING-258/JS/tree/main/Dino_Chrome'>ðŸ”—</a></li>
        </ul>
      </p>
    </section>
  );
}
function About() {
  return (
    <section id="about" className="section">
      <h2>About</h2>
      <p>This is the about section of your portfolio.</p>
    </section>
  );
}
function Contact() {
  return (
    <section id="contact" className="section">
      <h2>Contact Info</h2>
      <p>This is the contact info section of your portfolio.</p>
    </section>
  );
}

export default App;
